import './Cart.css';
import Button from "react-bootstrap/Button";

const Cart = ({item}) => {
    return(
        <div className='shoppingCart'>
            <h1> MY CART</h1>

           <Button variant="primary" href="/checkout">CONTINUE TO CHECKOUT</Button>
        </div>
    )
}

export default Cart;
